   // Check for date validity\n    if (!isValid(value) && isDevMode()) {\n      throw Error(`'${value}' is not a valid date.`);\n    }\n\n    // Check for format validity\n    if ((validFormats.indexOf(format) \n    \n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"pipes/TsTimeAgoPipe.html":{"url":"pipes/TsTimeAgoPipe.html","title":"pipe - TsTimeAgoPipe","body":"\n                   \n\n\n\n\n\n\n\n\n\n  Pipes\n  TsTimeAgoPipe\n\n\n\n    \n        Info\n    \n\n\n    \n        Source\n    \n\n\n\n\n    \n\n        \n            File\n        \n        \n            terminus-ui/src/pipes/time-ago/time-ago.pipe.ts\n        \n\n\n\n        \n            Metadata\n            \n                \n                    \n                        name\n                        tsTimeAgo\n                    \n                \n            \n        \n\n            \n                \n                    \n                        Methods\n                    \n                    \n                        \n                            \n                                \n                                    \n                                    \n                                        \n                                        transform\n                                        \n                                        \n                                    \n                                \n                            \n                            \n                                \n            transform(value: string | Date, comparedDate: string | Date)\n                                \n                            \n            \n            \n                                    \n                                        \n                                                Defined in terminus-ui/src/pipes/time-ago/time-ago.pipe.ts:16\n                                        \n                                    \n            \n                            \n                                \n            \n                                        \n                                                Parameters :\n                                                \n                                                    \n                                                        \n                                                            Name\n                                                                Type\n                                                            Optional\n                                                        \n                                                    \n                                                    \n                                                            \n                                                                value\n                                                                \n                                                                    \n                                                                                string | Date\n                                                                    \n                                                                \n                                                                \n                                                                        no\n                                                                \n                                                                \n            \n                                                            \n                                                            \n                                                                comparedDate\n                                                                \n                                                                    \n                                                                                string | Date\n                                                                    \n                                                                \n                                                                \n                                                                        no\n                                                                \n                                                                \n            \n                                                            \n                                                    \n                                                \n                                        \n                                        \n                                        \n                                        \n                                            Returns :     string\n            \n                                        \n                                            \n                                                \n                                            \n                                \n                            \n                        \n                    \n            \n\n\n    \n\n\n    \n        import {\n  Pipe,\n  PipeTransform,\n  isDevMode,\n} from '@angular/core';\nimport {\n  isValid,\n  formatDistance,\n} from 'date-fns';\n\n\n@Pipe({\n  name: 'tsTimeAgo',\n})\nexport class TsTimeAgoPipe implements PipeTransform {\n  transform(value: string|Date, comparedDate: string|Date): string {\n    // Check for null values to avoid issues during data-binding\n    if (value == null || value === '') {\n      return null;\n    }\n\n    // Check for date validity\n    if (!isValid(value) && isDevMode()) {\n      throw Error(`'${value}' is not a valid date.`);\n    }\n    if (!isValid(comparedDate) && isDevMode()) {\n      throw Error(`'${comparedDate}' is not a valid date.`);\n    }\n\n    // If dealing with a date objects, convert to strings\n    const date1: string = (typeof value === 'string') ? value : new Date(value).toISOString();\n    const date2: string =\n      (typeof comparedDate === 'string') ? comparedDate : new Date(comparedDate).toISOString();\n\n    return formatDistance(date1, date2);\n  }\n}\n\n\n    \n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"classes/TsRadioChange.html":{"url":"classes/TsRadioChange.html","title":"class - TsRadioChange","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n  Classes\n  TsRadioChange\n\n\n\n    \n        Info\n    \n\n    \n        README\n    \n\n    \n        Source\n    \n\n\n\n    \n        \n            File\n        \n        \n            terminus-ui/src/radio-group/radio-group.component.ts\n        \n\n            \n                Description\n            \n            \n                Expose the MatRadioChange event as TsRadioChange\n\n            \n\n            \n                Extends\n            \n            \n                    MatRadioChange\n            \n\n\n\n\n\n\n\n\n    \n\n    \n        \n\nTable of Contents\n\nEvent driven\nReactive form driven\n\n\nEvent driven\nPass in an array of items and listen for change events:\nitems$ = of([\n  {\n    value: 'foo',\n    displayValue: 'Foo',\n  },\n  {\n    value: 'bar',\n    displayValue: 'Bar',\n    disabled: true,\n  },\n  {\n    value: 'baz',\n    displayValue: 'Baz',\n    required: true,\n    checked: true,\n  },\n]);Reactive form driven\nPass in an array of items and pass in the form control:\n\n  \n\n  Submit\nSince we can set the default value in the form control, we do not need to add the checked property\nto any or our items.\nitems$ = of([\n  {\n    value: 'foo',\n    displayValue: 'Foo',\n  },\n  {\n    value: 'bar',\n    displayValue: 'Bar',\n    disabled: true,\n  },\n  {\n    value: 'baz',\n    displayValue: 'Baz',\n    required: true,\n  },\n]);\nmyForm = this.formBuilder.group({\n  myRadioGroup: [\n    'bar',\n    [\n      Validators.required,\n    ],\n  ],\n});\nNOTE: If you mark an item as checked you do not need to set the value in the form control. The\nTsRadioGroupComponent will find the checked item and update the form control.\n\n\n    \n\n    \n        import {\n  Component,\n  Input,\n  Output,\n  EventEmitter,\n  forwardRef,\n  ChangeDetectionStrategy,\n  ChangeDetectorRef,\n  ViewEncapsulation,\n  OnInit,\n} from '@angular/core';\nimport { NG_VALUE_ACCESSOR } from '@angular/forms';\nimport { MatRadioChange } from '@angular/material/radio';\n\nimport { TsStyleThemeTypes } from './../utilities/types';\nimport { TsReactiveFormBaseComponent } from './../utilities/reactive-form-base.component';\nimport { TsRadioOption } from './../utilities/interfaces/radio-option.interface';\n\n\n/**\n * Expose the MatRadioChange event as TsRadioChange\n */\nexport class TsRadioChange extends MatRadioChange {}\n\n\n/**\n * Custom control value accessor for our component\n * This allows our custom components to access the underlying form validation via the base class\n */\n/* tslint:disable:no-use-before-declare */\nexport const CUSTOM_RADIO_CONTROL_VALUE_ACCESSOR: any = {\n  provide: NG_VALUE_ACCESSOR,\n  useExisting: forwardRef(() => TsRadioGroupComponent),\n  multi: true,\n};\n/* tslint-enable: no-use-before-declare */\n\n\n/**\n * This is the radio UI Component\n *\n * #### QA CSS CLASSES\n * - `qa-radio-group`: The primary container\n * - `qa-radio-control`: An individual radio control\n * - `qa-radio-validation-messages`: The validation messages container\n *\n * @example\n * \n *\n * https://goo.gl/ieUPaG\n */\n@Component({\n  selector: 'ts-radio-group',\n  templateUrl: './radio-group.component.html',\n  styleUrls: ['./radio-group.component.scss'],\n  host: {\n    class: 'ts-radio-group',\n  },\n  exportAs: 'tsRadioGroup',\n  providers: [CUSTOM_RADIO_CONTROL_VALUE_ACCESSOR],\n  changeDetection: ChangeDetectionStrategy.OnPush,\n  encapsulation: ViewEncapsulation.None,\n})\nexport class TsRadioGroupComponent extends TsReactiveFormBaseComponent implements OnInit {\n  /**\n   * Accept an array of radio options in the {@link TsRadioOption} format\n   */\n  @Input()\n  public options: TsRadioOption[];\n\n  /**\n   * Define the theme. {@link TsStyleThemeTypes}\n   */\n  @Input()\n  public theme: TsStyleThemeTypes = 'primary';\n\n  /**\n   * Emit event when a selection occurs\n   */\n  @Output()\n  public change: EventEmitter = new EventEmitter();\n\n\n  constructor(\n    private changeDetectorRef: ChangeDetectorRef,\n  ) {\n    super();\n  }\n\n\n  /**\n   * Seed the initial value with the first checked option found\n   */\n  public ngOnInit(): void {\n    const initialSelection = this.defaultSelection(this.options);\n\n    if (initialSelection) {\n      this.value = initialSelection;\n\n      // istanbul ignore else\n      if (this.formControl) {\n        this.formControl.setValue(initialSelection);\n      }\n\n      // Tell Angular that we have updated the component internally\n      this.changeDetectorRef.markForCheck();\n    }\n  }\n\n\n  /**\n   * Return an option that should be checked by default\n   *\n   * If multiple items are marked as 'checked' by default, the first on found will win.\n   *\n   * @param options - The array of options\n   * @return The selected value\n   */\n  private defaultSelection(options: TsRadioOption[]): string | null {\n    const found = options.filter((v: TsRadioOption) => {\n      return v.checked;\n    });\n\n    return (found && found[0] && found[0].value) ? found[0].value : null;\n  }\n}\n\n    \n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"classes/TsSortBase.html":{"url":"classes/TsSortBase.html","title":"class - TsSortBase","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n  Classes\n  TsSortBase\n\n\n\n    \n        Info\n    \n\n    \n        README\n    \n\n    \n        Source\n    \n\n\n\n    \n        \n            File\n        \n        \n            terminus-ui/src/sort/sort.directive.ts\n        \n\n\n\n\n\n\n\n\n\n\n    \n\n    \n        \n\nTable of Contents\n\nAdding sort to table headers\nChanging the sort order\nDisabling sorting\nUsing sort with the ts-table\nAccessibility\n\n\nAdding sort to table headers\nTo add sorting behavior and styling to a set of table headers, add ts-sort-header to each header\nand provide an id that will identify it. These headers should be contained within a parent element\nwith the tsSort directive, which will emit a sortChange event when the user triggers sorting\non the header.\nUsers can trigger the sort header through a mouse click or keyboard action. When this happens, the\ntsSort will emit an sortChange event that contains the ID of the header triggered and the\ndirection to sort (asc or desc).\nChanging the sort order\nBy default, a sort header starts its sorting at asc and then desc. Triggering the sort header\nafter desc will remove sorting.\nTo reverse the sort order for all headers, set the tsSortStart to desc on the tsSort\ndirective. To reverse the order only for a specific header, set the start input only on the header\ninstead.\nTo prevent the user from clearing the sort sort state from an already sorted column, set\ntsSortDisableClear to true on the tsSort to affect all headers, or set disableClear to true on\na specific header.\nDisabling sorting\nIf you want to prevent the user from changing the sorting order of any column, you can use the\ntsSortDisabled binding on the ts-sort, or the disabled on an single ts-sort-header.\nUsing sort with the ts-table\nWhen used on an ts-table header, it is not required to set an ts-sort-header id on because by\ndefault it will use the id of the column.\nAccessibility\nThe aria-label for the sort button can be set in TsSortHeaderIntl.\n\n    \n\n    \n        import {\n  Directive,\n  EventEmitter,\n  Input,\n  isDevMode,\n  Output,\n  OnChanges,\n  OnDestroy,\n} from '@angular/core';\nimport { coerceBooleanProperty } from '@terminus/ngx-tools/coercion';\nimport { CanDisable, mixinDisabled } from '@angular/material/core';\nimport { Subject } from 'rxjs/Subject';\n\nimport { TsSortDirection } from './../utilities/types/sort.types';\nimport {\n  TsSortableItem,\n  TsSortState,\n} from './../utilities/interfaces/sort.interface';\nimport {\n  getSortInvalidDirectionError,\n  getSortDuplicateSortableIdError,\n  getSortHeaderMissingIdError,\n} from './sort-errors';\n\n\n// Boilerplate for applying mixins to TsSort.\nexport class TsSortBase {}\nexport const _TsSortMixinBase = mixinDisabled(TsSortBase);\n\n\n/**\n * Container for TsSortables to manage the sort state and provide default sort parameters\n */\n@Directive({\n  selector: '[tsSort]',\n  exportAs: 'tsSort',\n  inputs: ['disabled: tsSortDisabled'],\n})\nexport class TsSortDirective extends _TsSortMixinBase implements CanDisable, OnChanges, OnDestroy {\n  /**\n   * Collection of all registered sortables that this directive manages\n   */\n  private sortables = new Map();\n\n  /**\n   * Used to notify any child components listening to state changes\n   */\n  public _stateChanges = new Subject();\n\n  /**\n   * The id of the most recently sorted TsSortable\n   */\n  @Input('tsSortActive')\n  public active: string;\n\n  /**\n   * The direction to set when an TsSortable is initially sorted.\n   *\n   * May be overriden by the TsSortable's sort start.\n   */\n  @Input('tsSortStart')\n  public start: 'asc' | 'desc' = 'asc';\n\n  /**\n   * The sort direction of the currently active TsSortable\n   */\n  @Input('tsSortDirection')\n  public set direction(direction: TsSortDirection) {\n    if (isDevMode() && direction && direction !== 'asc' && direction !== 'desc') {\n      throw getSortInvalidDirectionError(direction);\n    }\n    this._direction = direction;\n  }\n  public get direction(): TsSortDirection { return this._direction; }\n  private _direction: TsSortDirection = '';\n\n  /**\n   * Whether to disable the user from clearing the sort by finishing the sort direction cycle.\n   *\n   * May be overriden by the TsSortable's disable clear input.\n   */\n  @Input('tsSortDisableClear')\n  public get disableClear() {\n    return this._disableClear;\n  }\n  public set disableClear(v: boolean) {\n    this._disableClear = coerceBooleanProperty(v);\n  }\n  private _disableClear: boolean;\n\n  /**\n   * Event emitted when the user changes either the active sort or sort direction\n   */\n  @Output('tsSortChange')\n  readonly sortChange = new EventEmitter();\n\n\n  /**\n   * Trigger next on all changes\n   */\n  public ngOnChanges(): void {\n    this._stateChanges.next();\n  }\n\n\n  /**\n   * Complete the observable on destroy\n   */\n  public ngOnDestroy(): void {\n    this._stateChanges.complete();\n  }\n\n\n  /**\n   * Register function to be used by the contained TsSortables. Adds the TsSortable to the\n   * collection of TsSortables.\n   */\n  register(sortable: TsSortableItem): void {\n    if (!sortable.id && isDevMode()) {\n      throw getSortHeaderMissingIdError();\n    }\n\n    if (this.sortables.has(sortable.id) && isDevMode()) {\n      throw getSortDuplicateSortableIdError(sortable.id);\n    }\n\n    this.sortables.set(sortable.id, sortable);\n  }\n\n\n  /**\n   * Unregister function to be used by the contained TsSortables. Removes the TsSortable from the\n   * collection of contained TsSortables.\n   */\n  deregister(sortable: TsSortableItem): void {\n    this.sortables.delete(sortable.id);\n  }\n\n\n  /**\n   * Sets the active sort id and determines the new sort direction\n   */\n  sort(sortable: TsSortableItem): void {\n    if (this.active !== sortable.id) {\n      this.active = sortable.id;\n      this.direction = sortable.start ? sortable.start : this.start;\n    } else {\n      this.direction = this.getNextSortDirection(sortable);\n    }\n\n    this.sortChange.next({active: this.active, direction: this.direction});\n  }\n\n\n  /**\n   * Returns the next sort direction of the active sortable, checking for potential overrides\n   */\n  getNextSortDirection(sortable: TsSortableItem): TsSortDirection {\n    if (!sortable) {\n      return '';\n    }\n\n    // Get the sort direction cycle with the potential sortable overrides.\n    const disableClear = sortable.disableClear != null ? sortable.disableClear : this.disableClear;\n    const sortDirectionCycle = getSortDirectionCycle(sortable.start || this.start, disableClear);\n\n    // Get and return the next direction in the cycle\n    let nextDirectionIndex = sortDirectionCycle.indexOf(this.direction) + 1;\n    if (nextDirectionIndex >= sortDirectionCycle.length) {\n      nextDirectionIndex = 0;\n    }\n\n    return sortDirectionCycle[nextDirectionIndex];\n  }\n\n}\n\n\n/**\n * Returns the sort direction cycle to use given the provided parameters of order and clear\n */\nfunction getSortDirectionCycle(start: 'asc' | 'desc', disableClear: boolean): TsSortDirection[] {\n  const sortOrder: TsSortDirection[] = ['asc', 'desc'];\n\n  if (start === 'desc') {\n    sortOrder.reverse();\n  }\n\n  if (!disableClear) {\n    sortOrder.push('');\n  }\n\n  return sortOrder;\n}\n\n    \n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"classes/TsSortHeaderBase.html":{"url":"classes/TsSortHeaderBase.html","title":"class - TsSortHeaderBase","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n  Classes\n  TsSortHeaderBase\n\n\n\n    \n        Info\n    \n\n\n    \n        Source\n    \n\n\n\n    \n        \n            File\n        \n        \n            terminus-ui/src/sort/sort-header.component.ts\n        \n\n\n\n\n\n\n\n\n\n\n    \n\n\n    \n        import {\n  ChangeDetectionStrategy,\n  ChangeDetectorRef,\n  Component,\n  Input,\n  Optional,\n  ViewEncapsulation,\n  OnInit,\n  OnDestroy,\n  isDevMode,\n} from '@angular/core';\nimport { CanDisable, mixinDisabled } from '@angular/material/core';\nimport { coerceBooleanProperty } from '@terminus/ngx-tools/coercion';\nimport { CdkColumnDef } from '@angular/cdk/table';\nimport { Subscription } from 'rxjs/Subscription';\nimport { merge } from 'rxjs/observable/merge';\n\nimport { TsSortDirective } from './sort.directive';\nimport { TsSortableItem } from './../utilities/interfaces/sort.interface';\nimport { TsSortHeaderIntl } from './sort-header-intl';\nimport { getSortHeaderNotContainedWithinSortError } from './sort-errors';\nimport { tsSortAnimations } from './sort-animations';\n\n\n// Boilerplate for applying mixins to the sort header.\nexport class TsSortHeaderBase {}\nexport const _TsSortHeaderMixinBase = mixinDisabled(TsSortHeaderBase);\n\n\n/**\n * Applies sorting behavior (click to change sort) and styles to an element, including an\n * arrow to display the current sort direction.\n *\n * Must be provided with an id and contained within a parent TsSortDirective.\n *\n * If used on header cells in a CdkTable, it will automatically default its id from its containing\n * column definition.\n */\n@Component({\n  // NOTE(B$): This component needs to be added to another component so we need a non-element\n  // selector\n  // tslint:disable: component-selector\n  selector: '[ts-sort-header]',\n  // tslint:enable: component-selector\n  exportAs: 'tsSortHeader',\n  templateUrl: './sort-header.component.html',\n  styleUrls: ['./sort-header.component.scss'],\n  host: {\n    class: 'ts-sortable',\n    '[class.ts-sort-header-sorted]': '_isSorted()',\n    '[class.ts-sort-header-disabled]': '_isDisabled()',\n    '(click)': '_handleClick()',\n  },\n  preserveWhitespaces: false,\n  encapsulation: ViewEncapsulation.None,\n  changeDetection: ChangeDetectionStrategy.OnPush,\n  inputs: ['disabled'],\n  animations: [\n    tsSortAnimations.indicator,\n    tsSortAnimations.leftPointer,\n    tsSortAnimations.rightPointer,\n    tsSortAnimations.indicatorToggle,\n  ],\n})\nexport class TsSortHeaderComponent extends _TsSortHeaderMixinBase implements TsSortableItem, CanDisable, OnInit, OnDestroy  {\n\n  /**\n   * Combination Subscription for all items that need to trigger change detection\n   */\n  private _rerenderSubscription: Subscription;\n\n  /**\n   * ID of this sort header. If used within the context of a CdkColumnDef, this will default to\n   * the column's name.\n   */\n  // NOTE(B$): Renaming input so that we can pull a value from the primary directive\n  // tslint:disable: no-input-rename\n  @Input('ts-sort-header')\n  id: string;\n  // tslint:enable: no-input-rename\n\n  /**\n   * Sets the position of the arrow that displays when sorted\n   */\n  @Input()\n  arrowPosition: 'before' | 'after' = 'after';\n\n  /**\n   * Overrides the sort start value of the containing TsSort for this TsSortable\n   */\n  @Input()\n  start: 'asc' | 'desc';\n\n  /**\n   * Overrides the disable clear value of the containing TsSort for this TsSortable\n   */\n  @Input()\n  get disableClear(): boolean {\n    return this._disableClear;\n  }\n  set disableClear(v: boolean) {\n    this._disableClear = coerceBooleanProperty(v);\n  }\n  private _disableClear: boolean;\n\n\n  /**\n   * Check for _sort and set up auto-change-detection\n   */\n  constructor(\n    public _intl: TsSortHeaderIntl,\n    changeDetectorRef: ChangeDetectorRef,\n    @Optional() public _sort: TsSortDirective,\n    @Optional() public _cdkColumnDef: CdkColumnDef,\n  ) {\n    super();\n\n    if (!_sort && isDevMode()) {\n      throw getSortHeaderNotContainedWithinSortError();\n    }\n\n    // Mark directive for change detection after any of these changes\n    this._rerenderSubscription = merge(_sort.sortChange, _sort._stateChanges, _intl.changes)\n      .subscribe(() => changeDetectorRef.markForCheck());\n  }\n\n\n  /**\n   * Default to cdk column name\n   */\n  public ngOnInit(): void {\n    if (!this.id && this._cdkColumnDef) {\n      this.id = this._cdkColumnDef.name;\n    }\n\n    this._sort.register(this);\n  }\n\n\n  /**\n   * Deregister sort and unsubscribe from observables\n   */\n  public ngOnDestroy(): void {\n    this._sort.deregister(this);\n    this._rerenderSubscription.unsubscribe();\n  }\n\n\n  /**\n   * Handles click events on the header\n   */\n  public _handleClick() {\n    if (!this._isDisabled()) {\n      this._sort.sort(this);\n    }\n  }\n\n\n  /**\n   * Whether this TsSortHeader is currently sorted in either ascending or descending order\n   */\n  public _isSorted() {\n    return this._sort.active == this.id &&\n        (this._sort.direction === 'asc' || this._sort.direction === 'desc');\n  }\n\n\n  /**\n   * Whether this TsSortHeader is disabled\n   */\n  public _isDisabled() {\n    return this._sort.disabled || this.disabled;\n  }\n}\n\n    \n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"classes/Version.html":{"url":"classes/Version.html","title":"class - Version","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n  Classes\n  Version\n\n\n\n    \n        Info\n    \n\n\n    \n        Source\n    \n\n\n\n    \n        \n            File\n        \n        \n            terminus-ui/src/utilities/version/version.ts\n        \n\n            \n                Description\n            \n            \n                Create version information from a version string\n\n            \n\n\n\n\n            \n                Index\n                \n                    \n                        \n                            \n                                Properties\n                            \n                        \n                        \n                            \n                                \n                                    \n                                            Public\n                                        full\n                                    \n                                    \n                                            Readonly\n                                            Public\n                                        major\n                                    \n                                    \n                                            Readonly\n                                            Public\n                                        minor\n                                    \n                                    \n                                            Readonly\n                                            Public\n                                        patch\n                                    \n                                \n                            \n                        \n                    \n                \n            \n\n            \n                Constructor\n                    \n                        \n                            \n                                \n            constructor(full: string)\n                                \n                            \n                                    \n                                        \n                                            Defined in terminus-ui/src/utilities/version/version.ts:7\n                                        \n                                    \n            \n                            \n                                \n                                        \n                                                Parameters :\n                                                \n                                                    \n                                                        \n                                                            Name\n                                                                Type\n                                                            Optional\n                                                        \n                                                    \n                                                    \n                                                            \n                                                                full\n                                                              \n                                                                    \n                                                                                string\n                                                                    \n                                                              \n                                                                \n                                                                        no\n                                                                \n                                                                \n                                                            \n                                                    \n                                                \n                                        \n                                \n                            \n                        \n                    \n            \n\n\n\n            \n                \n                    \n                        Properties\n                    \n                    \n                        \n                            \n                                \n                                    \n                                    \n                                        \n                                            Public\n                                        full\n                                        \n                                        \n                                    \n                                \n                            \n                            \n                                \n                                    full:     string\n            \n                                \n                            \n                                \n                                    \n                                        Type :     string\n            \n                                    \n                                \n                                    \n                                        \n                                                Defined in terminus-ui/src/utilities/version/version.ts:9\n                                        \n                                    \n            \n            \n                        \n                    \n                    \n                        \n                            \n                                \n                                    \n                                    \n                                        \n                                            Readonly\n                                            Public\n                                        major\n                                        \n                                        \n                                    \n                                \n                            \n                            \n                                \n                                    major:     string\n            \n                                \n                            \n                                \n                                    \n                                        Type :     string\n            \n                                    \n                                \n                                    \n                                        \n                                                Defined in terminus-ui/src/utilities/version/version.ts:5\n                                        \n                                    \n            \n            \n                        \n                    \n                    \n                        \n                            \n                                \n                                    \n                                    \n                                        \n                                            Readonly\n                                            Public\n                                        minor\n                                        \n                                        \n                                    \n                                \n                            \n                            \n                                \n                                    minor:     string\n            \n                                \n                            \n                                \n                                    \n                                        Type :     string\n            \n                                    \n                                \n                                    \n                                        \n                                                Defined in terminus-ui/src/utilities/version/version.ts:6\n                                        \n                                    \n            \n            \n                        \n                    \n                    \n                        \n                            \n                                \n                                    \n                                    \n                                        \n                                            Readonly\n                                            Public\n                                        patch\n                                        \n                                        \n                                    \n                                \n                            \n                            \n                                \n                                    patch:     string\n            \n                                \n                            \n                                \n                                    \n                                        Type :     string\n            \n                                    \n                                \n                                    \n                                        \n                                                Defined in terminus-ui/src/utilities/version/version.ts:7\n                                        \n                                    \n            \n            \n                        \n                    \n            \n\n    \n\n\n    \n        export class Version {\n  public readonly major: string;\n  public readonly minor: string;\n  public readonly patch: string;\n\n  constructor(public full: string) {\n    this.major = full.split('.')[0];\n    this.minor = full.split('.')[1];\n    this.patch = full.split('.').slice(2).join('.');\n  }\n}\n\nexport const VERSION = new Version('0.0.0-PLACEHOLDER');\n\n    \n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/Mask.html":{"url":"interfaces/Mask.html","title":"interface - Mask","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  Mask\n\n\n\n    \n        Info\n    \n\n    \n        README\n    \n\n    \n        Source\n    \n\n\n\n    \n        \n            File\n        \n        \n            terminus-ui/src/mask/mask.directive.ts\n        \n\n            \n                Description\n            \n            \n                An individual mask definition\n\n            \n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                            \n                                \n                                        mask\n                                \n                                \n                                            Optional\n                                        unmaskRegex\n                                \n                            \n                        \n                    \n                \n            \n        \n\n\n\n            \n                Properties\n                    \n                        \n                                \n                                    \n                                        \n                                        mask\n                                    \n                                \n                                \n                                    \n                                        mask:     (RegExp | string)[] | MaskFunction | \"undefined\"\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :     (RegExp | string)[] | MaskFunction | \"undefined\"\n\n                                        \n                                    \n\n\n\n\n                                    \n                                        \n                                            Defined in terminus-ui/src/mask/mask.directive.ts:31\n                                        \n                                    \n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        unmaskRegex\n                                    \n                                \n                                \n                                    \n                                        unmaskRegex:     RegExp\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :     RegExp\n\n                                        \n                                    \n\n                                    \n                                        \n                                            Optional\n                                        \n                                    \n\n\n\n                                    \n                                        \n                                            Defined in terminus-ui/src/mask/mask.directive.ts:32\n                                        \n                                    \n\n                        \n                    \n            \n    \n\n    \n        Mask\n\n\n\n\nTable of Contents\n\nBasic usage\nSupported input types\nDisable decimal support\nDisable sanitation\n\n\nBasic usage\nAttach the directive to an input and pass in a mask type:\n\nAvailable mask types:\n\n\n\nName\nExample format\n\n\n\n\nphone\n(900) 000-0000\n\n\ncurrency\n$0,000[.00]\n\n\nnumber\n0,000[.00]\n\n\npercentage\n0,000[.00]%\n\n\npostal\n00000|00000-0000\n\n\n\nSupported input types\n\ntext\ntel\nurl\npassword\nsearch\n\nDisable decimal support\n\nThis only effects the following masks: currency|number|percentage. By default, these masks\nsupport decimals.\n\nSet the allowDecimal flag to false:\n\nNOTE: You must use brackets [] for the allowDecimal flag.\n\nDisable sanitation\nBy default, the mask is removed from the string before it is saved to the model. To save the\nformatted value, set the sanitizeValue flag to false:\n\n    \n\n    \n        import {\n  Directive,\n  ElementRef,\n  forwardRef,\n  Input,\n  OnChanges,\n  Renderer2,\n  isDevMode,\n  SimpleChanges,\n} from '@angular/core';\nimport {\n  NG_VALUE_ACCESSOR,\n  ControlValueAccessor,\n} from '@angular/forms';\nimport { createTextMaskInputElement } from 'text-mask-core/dist/textMaskCore';\nimport createNumberMask from 'text-mask-addons/dist/createNumberMask';\n\n\nconst NUMBER_ONLY_REGEX: RegExp = /[^0-9]/g;\nconst NUMBER_WITH_DECIMAL_REGEX: RegExp = /[^0-9.]/g;\n\n/**\n * A function that returns an array of RegExp (used to determine postal code RegExp)\n */\nexport type MaskFunction = (value: string) => (RegExp|string)[];\n\n/**\n * An individual mask definition\n */\nexport interface Mask {\n  mask: (RegExp|string)[] | MaskFunction | false;\n  unmaskRegex?: RegExp;\n}\n\n/**\n * The collection of masks\n */\nexport interface MaskCollection {\n  [key: string]: Mask;\n}\n\n/**\n * Define the allowed mask shortcut option\n */\nexport type MaskShortcutOptions\n  = 'phone'\n  | 'currency'\n  | 'number'\n  | 'percentage'\n  | 'postal'\n  | 'default' // matches all characters\n;\n\n/**\n * Create an array used to verify the passed in shortcut is valid\n */\nconst allowedMaskShorcuts: MaskShortcutOptions[] = [\n  'phone',\n  'currency',\n  'number',\n  'percentage',\n  'postal',\n  'default',\n];\n\n/**\n * Value accessor implementation to provide to the directive\n */\n/* tslint:disable:no-use-before-declare */\nexport const MASKED_INPUT_VALUE_ACCESSOR: any = {\n  provide: NG_VALUE_ACCESSOR,\n  useExisting: forwardRef(() => TsMaskDirective),\n  multi: true,\n};\n/* tslint-enable: no-use-before-declare */\n\n\n@Directive({\n  host: {\n    '(input)': 'onInput($event.target.value)',\n    '(blur)': 'onTouched()',\n  },\n  selector: '[tsMask]',\n  exportAs: 'tsMask',\n  providers: [MASKED_INPUT_VALUE_ACCESSOR],\n})\nexport class TsMaskDirective implements ControlValueAccessor, OnChanges {\n  /**\n   * Store the current mask\n   */\n  private currentMask: Mask;\n\n  /**\n   * Store a reference to the input element\n   */\n  private inputElement: HTMLInputElement;\n\n  /**\n   * Store the last value for comparison\n   */\n  private lastValue: string;\n\n  /**\n   * Store the selected mask name\n   */\n  private maskName: MaskShortcutOptions;\n\n  /**\n   * Base settings for the mask\n   */\n  private textMaskConfig: any = {\n    mask: null,\n    guide: false,\n  };\n\n  /**\n   * Store the mask instance\n   */\n  private textMaskInputElement: any;\n\n  /**\n   * Define if decimals are allowed in numbers/currency/percentage\n   */\n  @Input()\n  public allowDecimal: boolean = true;\n\n  /**\n   * Define if the value should be sanitized before saving to the model\n   */\n  @Input()\n  public sanitizeValue: boolean = true;\n\n  /**\n   * Define a mask\n   */\n  @Input()\n  set tsMask(value: MaskShortcutOptions) {\n    if (!value) {\n      return;\n    }\n\n    // Verify value is allowed\n    if (isDevMode() && (allowedMaskShorcuts.indexOf(value)  any = (value: any) => {};\n\n\n  /**\n   * Set up for ValueChangeAccessor\n   */\n  public onTouched: (value: any) => any = (value: any) => {};\n\n\n  /**\n   * Set up for ValueChangeAccessor\n   */\n  public registerOnChange(fn: (value: any) => any): void {\n    this.onChange = fn;\n  }\n\n\n  /**\n   * Set up for ValueChangeAccessor\n   */\n  public registerOnTouched(fn: () => any): void {\n    this.onTouched = fn;\n  }\n\n\n  /**\n   * Create the mask\n   *\n   * @param create - If the mask should be created\n   */\n  private setupMask(create?: boolean): void {\n    // istanbul ignore else\n    if (!this.inputElement) {\n      this.inputElement = this.elementRef.nativeElement;\n    }\n\n    // istanbul ignore else\n    if (this.inputElement && create) {\n      const maskOptions = Object.assign({inputElement: this.inputElement}, this.textMaskConfig);\n      // Initialize the mask\n      this.textMaskInputElement = createTextMaskInputElement(maskOptions);\n    }\n  }\n\n\n  /**\n   * Remove the mask if needed\n   *\n   * @param value - The value to clean\n   * @param regex - The RegExp to use to clean the value\n   * @return The clean value\n   */\n  private cleanValue(value: string, regex?: RegExp): string {\n    return regex ? value.replace(new RegExp(regex), '') : value;\n  }\n\n\n  /**\n   * Helper to determine the correct postal code match\n   *\n   * @param value - The current postal code value\n   * @return The correct mask\n   */\n  private determinePostalMask(value: string): (RegExp|string